import PacientService from '../services/PacientService';

class MyProfile extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            id:21,
            name:"",
            surname:"",
            dob:"",
            pesel:"",
            age:0,


        }
    }
    componentDidMount(){

        PacientService.getPacients().then((response)=>{
            let arr = response.data;
            arr.map(pacient => {
                if (pacient.id===this.state.id){
                    this.setState({name:pacient.firstName,surname:pacient.lastName,dob:pacient.dob,pesel:pacient.pesel, age:pacient.age})
                }
            })
        });
    }
    render(){
        return(
            <>
            <nav>

                    <ul className="">

                        <li ><NavLink to='/appoinments' exact>Moje wizyty</NavLink></li>
                        <li ><NavLink to='/addAppointment' exact>Dodaj wizytÄ™</NavLink></li>
                    </ul>
            </nav>
            <h2>Informacje o koncie</h2>
            <ul>
                <li>Imie</li>
                <li>Nazwisko</li>
                <li>Pesel</li>
                <li>Data urodzenia</li>
                <li>Wiek</li>

            </ul>
            </>
        )
        }

}


export default MyProfile;
